  return (
    <div className="App">

      <NavbarComponent/>
      <FooterComponent/>
      <CurriculoComponent/>
      <Router>
      <NavBar />  {/* Colocando a Navbar */}
      <Container className="mt-5">
        <Routes>
          {/* Definindo as rotas */}
          <Route path="/cadastrar" element={<Curriculo />} />
          {/* Outras rotas podem ser adicionadas aqui */}
        </Routes>
      </Container>
    </Router>

    </div>
  );
}

export default App;
